import React from 'react';
import { Modal, Button } from 'react-bootstrap';
import "./index.scss";
import bgImage from '/var/www/vhosts/website/src/Assets/Images/live-bg.png';
import playBtn from '/var/www/vhosts/website/src/Assets/Images/play-btn.png';
import ModelBtns from '../ModelButtons/ModelBtns';

const NowLiveComponet = ({page,para }) => {
  return (
    <div className='nowlive-container' style={{backgroundImage:`url(${bgImage})`}}>
      <div className="liveFlag" >
         Now Live
      </div>
      <img src={playBtn} alt=''/>
      <div className='content'>
        <h2>Live Now</h2>
        <p>September 14, 2024</p>
        {page == true &&(
          <div>
            <ModelBtns/>
            <p className='cardDescription'>{para}</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default NowLiveComponet;
